import React, { useState } from 'react';
import InputBoard from '../src/components/InputBoard.jsx';
import Head from 'next/head';

function Page(props) {
    const [state, setState] = useState({
        board: [[]]
    })

    let updateBoard = (updatedBoard) => {
        setState({
            board: updatedBoard
        })
    }

    return (
        <div>

            <InputBoard updateBoard={updateBoard} />
        </div>
    )
}


export default Page;
